            part13total = Inputs.var_qty13.Value * Inputs.var_part13price.Value;
            part14total = Inputs.var_qty14.Value * Inputs.var_part14price.Value;
            part15total = Inputs.var_qty15.Value * Inputs.var_part15price.Value;
            part16total = Inputs.var_qty16.Value * Inputs.var_part16price.Value;
            allparttotal = (part1total + part2total + part3total + part4total + part5total + part6total + part7total + part8total + part9total + part10total + part11total + part12total + part13total + part14total + part15total + part16total);

            /* Costing Calc if costing method is set as LIST in the CSV */
            if ((Inputs.var_costingmethod.Value == "LIST") && (manualpricerqd == "False") && (Inputs.var_manualpriceentry.Value == false))
            {

                Inputs.chr_manualprice.Value = true;
								Inputs.chr_manualprice.Label =  "Calculated Using List Price:";

                if (multipliertype == "Multiply")
                {
                    Inputs.var_listpricetotal.Value = (((allparttotal) / (Inputs.var_margin.Value / 100)) * Inputs.var_exchangerate.Value) * Inputs.var_listpricemultiplier.Value;
                }
            }

            /* Requirement to Enter a Manual Price if a BOM price is missing */

            if ((Inputs.var_costingmethod.Value == "LIST") && (manualpricerqd == "True"))
            {
                Inputs.chr_manualprice.Value = true;

								Inputs.chr_manualprice.Label = "Please Enter a Price Manually:";
								Inputs.TEXT46.Label = "Insufficient Pricing Data Available.";

                Inputs.var_manualpriceentry.Value = true;
            }

/* Verifies the list price is not zero */

if ((Inputs.var_listpricetotal.Value == 0) && ( Inputs.chk_allowzero.Value == false) && ( Inputs.var_part1.Value!="")) {

	MessageBox.Show("The Unit Price is currently set at Zero, if this is correct please tick the Allow Zero Price check box.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
	PageLeaveFunctions.SetNextInputPage(5);
	Args.Cancel = true;


}
